        ctx.setState({
          ...state,
          gmeRotations: [readOnlyResult, ...state.gmeRotations].sort((a, b) =>
            a.startDate > b.startDate ? 1 : -1
          ),
          selectedRotation: undefined,
          errors: null,
        });
      }),
      catchError((httpError: HttpErrorResponse) => {
