    const statesMap = ctx.getState()?.statesMap
      ? ctx.getState()?.statesMap
      : {};
    if (payload?.countryCode && statesMap[payload.countryCode]) {
      const states: IStateReadOnlyModel[] | undefined =
        statesMap[payload.countryCode];
      ctx.patchState({
        states,
