import {
  Component,
  CUSTOM_ELEMENTS_SCHEMA,
  EventEmitter,
  Input,
  Output,
} from '@angular/core';
import { CommonModule } from '@angular/common';
import { SlChangeEvent } from '@shoelace-style/shoelace';

@Component({
  selector: 'abs-select-wrapper',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './select-wrapper.component.html',
  styleUrls: ['./select-wrapper.component.scss'],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class SelectWrapperComponent {
  @Output() valueChange: EventEmitter<string | undefined> = new EventEmitter<
    string | undefined
  >();
  // eslint-disable-next-line @angular-eslint/no-output-native
  @Output() change: EventEmitter<SlChangeEvent> =
    new EventEmitter<SlChangeEvent>();
  // @Output() label: string | undefined;
  // @Output() name: string | undefined;

  _value: string | undefined;

  @Input()
  get value(): string | undefined {
    // console.log('GET', this._value);
    return this._value;
  }
  set value(value: string | undefined) {
    // console.log('SET', this._value, value);
    this._value = value;
    this.valueChange.emit(value);
  }

  dispatchChange(event: SlChangeEvent) {
    // console.log('DISPATCH', event);
    this.change.emit(event);
  }

  changeBtn() {
    this.value = 'option-1';
  }
}

import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Router, RouterLink, RouterLinkActive } from '@angular/router';
import { IMenuItem } from 'src/web-components/menuItem';
import { NgxsModule, Store } from '@ngxs/store';
import { Logout } from '../state';
import { CERTIFIED_NAV_ITEMS, TRAINEE_NAV_ITEMS } from './nav-items';

@Component({
  selector: 'abs-side-navigation',
  standalone: true,
  imports: [CommonModule, RouterLink, RouterLinkActive, NgxsModule],
  templateUrl: './side-navigation.component.html',
  styleUrls: ['./side-navigation.component.scss'],
})
export class SideNavigationComponent implements OnInit {
  @Output() handleSideNavToggle: EventEmitter<any> = new EventEmitter();
  @Input() currentStatus: string | undefined;
  @Input() isSurgeon = false;

  navItems: Array<IMenuItem> = TRAINEE_NAV_ITEMS;

  constructor(private _router: Router, private _store: Store) {}

  ngOnInit(): void {
    this.getNavItemsByUserRoll();
  }

  getNavItemsByUserRoll() {
    if (this.isSurgeon) {
      this.navItems = CERTIFIED_NAV_ITEMS;
    }
  }

  logout() {
    this._store.dispatch(new Logout());
  }

  toggleSideNav() {
    this.handleSideNavToggle.emit();
  }

  toggleSubNav(item: IMenuItem) {
    console.log(item);
  }

  get router(): Router {
    return this._router;
  }
}

