      fileType: fileType,
      cellRenderer: 'fileLink',
      cellRendererParams: {
        fieldKey: fieldName,
        onClick,
      },
      sortable,
      width,
    };

    return colDef;
  },

  setExpandToggle(
    headerName: string,
    fieldName: string,
    onClick?: (data: any) => void,
    sortable?: boolean,
    width?: number
  ) {
    const colDef = {
      headerName: headerName,
      field: fieldName,
      cellRenderer: 'expandToggle',
      cellRendererParams: {
        fieldKey: fieldName,
        onClick,
      },
      sortable,
      width,
    };

    return colDef;
  },

  setFormattedDateCol(
    headerName: string,
    fieldName: string,
    sortable?: boolean,
    width?: number
  ) {
    const colDef = {
      headerName,
      field: fieldName,
      cellRenderer: 'dateFormatter',
      sortable,
      width,
    };
    return colDef;
  },

