    headerName: string,
    fieldName: string,
    className?: string,
    sortable?: boolean,
    width?: number
  ) {
    const colDef = {
      headerName,
      field: fieldName,
      cellRenderer: 'customClass',
      cellClass: (fieldName: string) => {
        return className ?? fieldName;
      },
      sortable,
      width,
